import{_ as t}from"./plugin-vue_export-helper.21dcd24c.js";import{o as e,c as a,e as r}from"./app.41843ea8.js";const d={},p=r('<table><thead><tr><th style="text-align:center;">\u9879\u76EE</th><th style="text-align:center;">\u60C5\u51B5</th></tr></thead><tbody><tr><td style="text-align:center;">\u5BBF\u820D\u72EC\u536B</td><td style="text-align:center;">\u2705</td></tr><tr><td style="text-align:center;">\u5BBF\u820D\u72EC\u6D74</td><td style="text-align:center;">\u2705</td></tr><tr><td style="text-align:center;">\u7B2C\u4E09\u536B\u751F\u95F4</td><td style="text-align:center;">\uFF1F</td></tr><tr><td style="text-align:center;">\u519B\u8BAD\u51ED\u533B\u7597\u6750\u6599\u51CF\u514D</td><td style="text-align:center;">\u2705</td></tr><tr><td style="text-align:center;">\u519B\u8BAD\u4E0D\u7BA1\u5934\u53D1</td><td style="text-align:center;">\u2705</td></tr><tr><td style="text-align:center;">\u4F53\u80B2\u51ED\u533B\u7597\u6750\u6599\u51CF\u514D</td><td style="text-align:center;">\u2705</td></tr><tr><td style="text-align:center;">\u533B\u4FDD\u4F7F\u7528</td><td style="text-align:center;">\u2705</td></tr><tr><td style="text-align:center;">\u6821\u533B\u9662\u670D\u52A1</td><td style="text-align:center;">\u274C</td></tr></tbody></table><p>\u63D0\u793A\uFF1A\u82E5\u5BF9\u4E2D\u533B\u5B66\u7C7B\u3001\u4E2D\u836F\u5B66\u7C7B\u3001\u836F\u5B66\u7C7B\u65E0\u611F\uFF0C\u5EFA\u8BAE\u4E0D\u62A5\u8003\u672C\u6821\u3002\u53E6\uFF0C\u672C\u6821\u6709\u4E34\u5E8A\u533B\u5B66\u3001\u8BA1\u7B97\u673A\u7C7B\u7B49\u4E13\u4E1A\uFF0C\u5728\u6B64\u5904\u4E0D\u52A0\u8D58\u8FF0\uFF0C\u53EF\u67E5\u770B\u5B66\u6821\u53D1\u5E03\u7684\u76F8\u5173\u7AE0\u7A0B\u3002</p><p>\u63A8\u8350\u672C\u6821\u7684\u539F\u56E0\u662F\u5176\u80FD\u4E0E\u9694\u58C1\u5357\u4EAC\u5927\u5B66\u76F8\u6BD4\u7684\u5BBF\u820D\u73AF\u5883\uFF0C\u4EE5\u53CA\u76F8\u5BF9\u8F7B\u677E\u7684\u5C31\u8BFB\u73AF\u5883\u548C\u5C31\u8BFB\u5730\u533A\u3002\uFF08\u5728\u72EC\u7ACB\u536B\u6D74\u4E0A\u751A\u81F3\u66F4\u80DC\u4E00\u7B79\uFF09\u3002</p><p>\u672C\u6587\u4E3B\u8981\u8BBA\u53CA\u4ED9\u6797\u6821\u533A\uFF0C\u6C49\u4E2D\u95E8\u6821\u533A\u7684\u6761\u4EF6\u539F\u672C\u8F83\u5DEE\uFF0C\u4F46 2021 \u5E74\u88C5\u4FEE\u8FC7\u540E\u60C5\u51B5\u6709\u5F88\u5927\u6539\u89C2\u3002\u6CF0\u5DDE\u6821\u533A\u7531\u72EC\u7ACB\u5B66\u9662\u8F6C\u8BBE\u800C\u6765\uFF0C\u60C5\u51B5\u5C1A\u4E0D\u660E\u786E\u3002</p><h2 id="\u5730\u7406\u4F4D\u7F6E-\u5B66\u6821\u8BBE\u65BD" tabindex="-1"><a class="header-anchor" href="#\u5730\u7406\u4F4D\u7F6E-\u5B66\u6821\u8BBE\u65BD" aria-hidden="true">#</a> \u5730\u7406\u4F4D\u7F6E&amp;\u5B66\u6821\u8BBE\u65BD</h2><p>\u5357\u4E2D\u533B\u4ED9\u6797\u6821\u533A\u6574\u4F53\u89C4\u6A21\u4E0D\u5927\uFF0C\u4E0D\u8FC7\u7531\u4E8E\u5BBF\u820D\u533A\u4F4D\u539F\u56E0\uFF0C\u79BB\u6559\u5B66\u533A\u76F8\u5BF9\u8FDC\u548C\u5171\u4EAB\u5355\u8F66\u8D44\u6E90\u5728\u65E9\u6668\u5BB9\u6613\u7A00\u7F3A\uFF0C\u82E5\u60F3\u8981\u65B9\u4FBF\u51FA\u884C\u9700\u8981\u65E9\u8D77\uFF0C\u6216\u8D2D\u4E70\u4E00\u8F86\u81EA\u5DF1\u7684\u4E13\u5C5E\u81EA\u884C\u8F66\u3002</p><p>\u6821\u95E8\u53E3\u8FC7\u4E00\u4E2A\u5730\u4E0B\u901A\u9053\u5C31\u662F\u5730\u94C1\u7AD9\uFF08\u7F8A\u5C71\u516C\u56ED\uFF09\uFF0C\u5730\u94C1\u9694\u58C1\u7AD9\u5373\u4E3A\u5357\u4EAC\u5927\u5B66\u4ED9\u6797\u6821\u533A\uFF0C\u53EF\u4EE5\u65B9\u4FBF\u5730\u6362\u4E58\u81F3\u5176\u4ED6\u5B66\u6821\u3002</p><h2 id="\u533B\u7597\u8D44\u6E90" tabindex="-1"><a class="header-anchor" href="#\u533B\u7597\u8D44\u6E90" aria-hidden="true">#</a> \u533B\u7597\u8D44\u6E90</h2><p>\u867D\u7136\u672C\u6821\u662F\u533B\u5B66\u7C7B\u9662\u6821\uFF0C\u4F46\u6821\u533B\u9662\u5728\u5927\u5BB6\u53E3\u4E2D\u786E\u5B9E\u662F\u201C\u5EB8\u533B\u201D\u7684\u5B58\u5728\uFF0C\u4E0D\u8FC7\u5982\u679C\u5F00\u7684\u662F\u4E2D\u836F\uFF0C\u751A\u81F3\u53EF\u4EE5\u501F\u7740\u201C\u8001\u5E08\u63A8\u8350\u201D\u7684\u540D\u4E49\u5728\u6821\u533B\u5904\u5F00\u5904\u65B9\u3002</p><p>\u5730\u94C1\u53EF\u4EE5\u5728\u8FDB\u5165\u4E3B\u57CE\u533A\u540E\u6362\u4E58\u81F3\u9F13\u697C\u5230\u5357\u4EAC\u5927\u5B66\u9F13\u697C\u533B\u9662\uFF0C\u5F53\u7136\u672C\u6821\u897F\u6821\u95E8\u9644\u8FD1\u4EA6\u6709\u4ED9\u6797\u9F13\u697C\u533B\u9662\uFF0C\u4F46\u5177\u4F53\u533B\u7597\u60C5\u51B5\u672A\u6709\u4E86\u89E3\u3002</p><p>\u6821\u5185\u5DF2\u6709 MtF \u5F00\u5230\u4E86\u66F9\u79CB\u4E91\u8001\u5E08\u7684\u8BC1\u660E\u3002</p><h2 id="\u519B\u8BAD\u548C\u4F53\u80B2" tabindex="-1"><a class="header-anchor" href="#\u519B\u8BAD\u548C\u4F53\u80B2" aria-hidden="true">#</a> \u519B\u8BAD\u548C\u4F53\u80B2</h2><p>\u5F80\u5C4A\u519B\u8BAD\u57FA\u672C\u90FD\u5728\u6821\u5185\u8FDB\u884C\uFF0C\u5E76\u4E14\u5F3A\u5EA6\u4E0D\u7B97\u5927\uFF0C\u4E14\u4E0D\u7B97\u4E25\u683C\uFF0C\u5BF9\u5934\u53D1\u66F4\u662F\u6CA1\u6709\u8981\u6C42\uFF0C\u82E5\u6709\u76F8\u5173\u8BC1\u660E\u53EF\u4EE5\u7533\u8BF7\u514D\u8BAD\u3002</p><p>\u7531\u4E8E\u75AB\u60C5\u5F71\u54CD\uFF0C\u5DF2\u6709\u4E24\u5C4A\u5B66\u751F\u7684\u519B\u8BAD\u88AB\u62D6\u5EF6\u3002</p><p>\u4F53\u80B2\u8BFE\u5206\u56DB\u4E2A\u5B66\u671F\uFF0C\u7B2C\u4E00\u5B66\u671F\u4E3A\u8EAB\u4F53\u7D20\u8D28\u8BAD\u7EC3\uFF0C\u7B2C\u4E8C\u5B66\u671F\u56FA\u5B9A\u4E3A\u592A\u6781\u62F3\uFF0C\u7B2C\u4E09\u3001\u7B2C\u56DB\u5B66\u671F\u4E3A\u4EFB\u9009\u4F53\u80B2\u8BFE\uFF0C\u5305\u62EC\uFF1A\u7BEE\u7403\u3001\u8DB3\u7403\u3001\u6392\u7403\u3001\u6C14\u6392\u7403\u3001\u7F51\u7403\u3001\u7FBD\u6BDB\u7403\u3001\u4E52\u4E53\u7403\u3001\u666E\u62C9\u63D0\u3001\u5065\u7F8E\u64CD\u3001\u5973\u5B50\u9632\u8EAB\u672F\u3001\u8DC6\u62F3\u9053\u3001\u6563\u6253\u3001\u5F62\u4F53\u3001\u745C\u4F3D\u3001\u5EB7\u590D\u4FDD\u5065\u4F53\u80B2\u3001\u6E38\u6CF3\u3001\u957F\u62F3\u4E09\u8DEF\u3001\u4E09\u5341\u4E8C\u5F0F\u592A\u6781\u5251\u3001\u516B\u6BB5\u9526\u3001\u6613\u7B4B\u7ECF\u7B49\u9879\u76EE\u3002</p><p>\u90E8\u5206\u4F53\u80B2\u8001\u5E08\u5BF9\u5B66\u751F\u8981\u6C42\u6781\u4E3A\u4E25\u82DB\uFF0C\u5EFA\u8BAE\u6839\u636E\u5B66\u957F\u5B66\u59D0\u7684\u7ECF\u9A8C\u907F\u96F7\u3002</p><p>\u4F53\u80B2\u8BFE\u6210\u7EE9\u4E0D\u8BA1\u5165\u7EE9\u70B9\uFF0C\u6302\u79D1\u4EA6\u4E0D\u8BA1\u5165\u603B\u6302\u79D1\u6570\u76EE\u3002\u4F46\u4F53\u6D4B\u6210\u7EE9\u548C\u5956\u5B66\u91D1\u6302\u94A9</p><p>\u203B\u4F53\u6D4B\u6210\u7EE9\u81EA 2020 \u7EA7\u8D77\u4E0E\u662F\u5426\u80FD\u62FF\u5230\u6BD5\u4E1A\u8BC1\u76F8\u5173\u8054\uFF0C\u8BA1\u7B97\u65B9\u6CD5\u4E3A\uFF1A</p><p>\u7EC8\u6210\u7EE9 = \u524D\u4E09\u6B21\u4F53\u6D4B\u6210\u7EE9 x50% + \u7B2C\u56DB\u6B21\u4F53\u6D4B\u6210\u7EE9 x50%</p><p>\u82E5\u6700\u7EC8\u6210\u7EE9\u5C0F\u4E8E 50 \u5206\uFF08\u4E0D\u662F\u53CA\u683C\u7EBF\uFF09\uFF0C\u5219\u6309\u7167\u8084\u4E1A\u6216\u7ED3\u4E1A\u5904\u7406\u3002</p><p>\u56E0\u6B64\uFF0C\u82E5\u9009\u62E9 HRT\uFF0C\u8FD8\u662F\u5C3D\u91CF\u7533\u8BF7\u5230\u5EB7\u590D\u4FDD\u5065\u8BFE\u4E3A\u597D\uFF0C\u5728\u5F00\u5B66\u4E24\u5468\u5185\u81F3\u6821\u79D8\u4E66\u5904\u529E\u7406\u786E\u8BA4\u624B\u7EED\u3002\u6839\u636E\u6700\u65B0\u8981\u6C42\uFF0C\u5EB7\u590D\u4FDD\u5065\u8BFE\u73B0\u7EDF\u4E00\u5728\u7EBF\u4E0A\u8FDB\u884C\u3002</p><h2 id="\u5BBF\u820D\u60C5\u51B5\u4E0E\u57FA\u7840\u8BBE\u65BD" tabindex="-1"><a class="header-anchor" href="#\u5BBF\u820D\u60C5\u51B5\u4E0E\u57FA\u7840\u8BBE\u65BD" aria-hidden="true">#</a> \u5BBF\u820D\u60C5\u51B5\u4E0E\u57FA\u7840\u8BBE\u65BD</h2><p>\u6821\u56ED\u7F51\u514D\u8D39\u4F7F\u7528\uFF0C\u5BBF\u820D 24 \u5C0F\u65F6\u4E0D\u65AD\u7535\uFF0C\u5B9E\u6D4B 800W \u7684\u7535\u5439\u98CE\u53EF\u4EE5\u76F4\u8FDE\u800C\u4E0D\u4F1A\u8DF3\u95F8\uFF0C\u4F46\u7535\u5439\u98CE\u5C5E\u4E8E\u8FDD\u7AE0\u7535\u5668\uFF0C\u8FD8\u662F\u4E0D\u80FD\u88AB\u53D1\u73B0\u7684\u54E6~\u4E3A\u4E86\u5B89\u5168\u8D77\u89C1\uFF0C\u8BF7\u968F\u7528\u968F\u6536\u54E6\u3002</p><p>\u56E0\u4E3A\u53EF\u5B89\u88C5\u5E8A\u5E18\uFF0C\u6240\u4EE5\u53EF\u4EE5\u5C1D\u8BD5\u5728\u5E8A\u4E0A\u5B89\u88C5\u6392\u63D2\uFF0C\u7535\u5439\u98CE\u5C31\u4E0D\u4F1A\u88AB\u53D1\u73B0\u5566~</p><p>\u5728\u4ED9\u6797\u6821\u533A\uFF0C\u672C\u79D1\u751F\u5BBF\u820D\u662F\u4E09\u4E2A\u56DB\u4EBA\u95F4\u548C\u4E8C\u4EBA\u95F4\u62FC\u6210\u4E00\u4E2A\u5927\u5385\uFF0C\u6240\u4EE5\u4E0E\u540C\u73ED\u7684\u540C\u5B66\u4EA4\u6D41\u4F1A\u5F88\u591A\uFF0C\u6BCF\u95F4\u5BBF\u820D\u90FD\u662F\u4E0A\u5E8A\u4E0B\u684C\u3002</p><p>\u6C90\u6D74\u548C\u536B\u751F\u95F4\u7686\u662F\u72EC\u7ACB\u9694\u95F4\u7684\uFF0C\u4E00\u822C\u6BCF\u4E2A\u5927\u5385\u914D\u5907 3 \u4E2A\u536B\u751F\u95F4\u548C 3 \u4E2A\u6C90\u6D74\u95F4\u3002\uFF082021 \u5E74\u65B0\u751F\u72EC\u7ACB\u536B\u6D74\u88C5\u4FEE\uFF0C\u867D\u7136\u529F\u80FD\u4E0A\u5DEE\u5F02\u4E0D\u5927\uFF0C\u4F46\u6574\u4F53\u4F53\u9A8C\u611F\u4F1A\u66F4\u597D\uFF0C\u770B\u8D77\u6765\u50CF\u9152\u5E97\u3002\uFF09</p><p>\u90E8\u5206\u5BBF\u820D\u65E0\u5916\u9633\u53F0\uFF0C\u56E0\u6B64\u670D\u88C5\u65B9\u9762\u786E\u5B9E\u662F\u4E00\u4EF6\u5934\u75BC\u7684\u4E8B\u60C5\u5462\uFF0C\u4E0D\u8FC7\u5982\u679C\u9047\u5230\u4E86\u597D\u7684\u8F85\u5BFC\u5458\uFF0C\u548C Ta \u597D\u597D\u8BF4\u660E\u4E00\u4E0B\u60C5\u51B5\u8FD8\u662F\u6709\u673A\u4F1A\u7533\u8BF7\u5230\u5355\u95F4\u7684\uFF0C\u6216\u8005\u548C\u80FD\u591F\u7406\u89E3\u5C0A\u91CD\u81EA\u5DF1\u7684\u7537\u5B69\u5B50\u4F4F\u5728\u4E00\u8D77\u4E5F\u662F\u4E00\u4E2A\u4E0D\u9519\u7684\u89E3\u51B3\u65B9\u6848\u3002</p><h2 id="\u5176\u4ED6-mtf-\u76F8\u5173" tabindex="-1"><a class="header-anchor" href="#\u5176\u4ED6-mtf-\u76F8\u5173" aria-hidden="true">#</a> \u5176\u4ED6 MtF \u76F8\u5173</h2><p>\u672C\u6821\u6682\u65E0 LGBT \u76F8\u5173\u7EC4\u7EC7\uFF0C\u5FC3\u534F\u4E5F\u672A\u6709\u5BF9 LGBT \u9886\u57DF\u5C55\u5F00\u5EFA\u8BBE\uFF0C\u4F46\u6821\u5185\u6709\u76F8\u5173\u7684\u514D\u8D39\u5FC3\u7406\u54A8\u8BE2\u9884\u7EA6\uFF0C\u4EA6\u6709 24 \u5C0F\u65F6\u5371\u673A\u5E72\u9884\u70ED\u7EBF\u3002</p><p>\u5982\u679C\u60F3\u8981\u8FDB\u884C\u5FC3\u7406\u54A8\u8BE2\uFF0C\u53EF\u4EE5\u5C1D\u8BD5\u9EC4\u7231\u56FD\u8001\u5E08\u3002\u8BF7\u907F\u96F7\u738B\u633A\u8001\u5E08\uFF0C\u8FD9\u4F4D\u8001\u5E08\u4E0D\u4EC5\u4E0D\u80FD\u6CBB\u6108\u4F60\uFF0C\u8FD8\u4F1A\u5728\u6027\u76F8\u5173\u8BDD\u9898\u4E0A\u65E0\u610F\u95F4\u52A0\u91CD MtF \u7684\u6027\u522B\u7126\u8651\u3002</p><p>\u7531\u4E8E\u6821\u5185\u987A\u6027\u522B\u5973\u751F\u57FA\u6570\u8F83\u5927\uFF0C\u5728\u7B14\u8005\u770B\u6765\u73AF\u5883\u8FD8\u662F\u76F8\u5BF9\u5305\u5BB9\u7684\uFF0C\u5982\u679C\u80FD\u9047\u5230\u77E5\u5FC3\u54E5\u54E5\u59D0\u59D0\u90A3\u6837\u7684\u8F85\u5BFC\u5458\uFF0C\u6216\u8BB8\u73AF\u5883\u8FD8\u662F\u5F88\u6E29\u6696\u7684\u5566~</p><p>\u6821\u5185 MtF \u8F83\u5C11\uFF0C\u76EE\u524D\u5305\u62EC\u7B14\u8005\u5728\u5185\u5171\u6709\u4E24\u53EA\u3002</p><p>\u7EDF\u8BA1\uFF08\u622A\u6B62 2022 \u5E74 3 \u6708 24 \u65E5\uFF09</p><p>\u7B2C\u4E00\u4E34\u5E8A\u533B\u5B66\u9662 1\uFF08\u662F\u9177\u59B9\uFF09</p><p>\u4E2D\u533B\u5B66\u9662\xB7\u4E2D\u897F\u533B\u7ED3\u5408\u5B66\u9662 1\uFF08\u662F\u53EF\u7231\u53CC\u9A6C\u5C3E\u5C11\u5973\uFF09</p><h3 id="\u6821\u5185\u81EA\u4E60-\u5377\u738B\u6307\u5357" tabindex="-1"><a class="header-anchor" href="#\u6821\u5185\u81EA\u4E60-\u5377\u738B\u6307\u5357" aria-hidden="true">#</a> \u6821\u5185\u81EA\u4E60 <s>\u5377\u738B\u6307\u5357</s></h3><p>\u9664\u671F\u672B\u5916\uFF0C\u6821\u5185\u56FE\u4E66\u9986\u3001\u6559\u5BA4\u5168\u5929\u53EF\u5B9E\u73B0\u81EA\u4E60\u81EA\u7531\u3002\u671F\u672B\u8BF7\u907F\u514D\u5728\u56FE\u4E66\u9986\uFF0C\u5C24\u5176\u662F\u56FE\u4E66\u9986\u4E00\u697C\u81EA\u4E60\uFF0C\u7A7A\u6559\u5BA4\u5728\u671F\u672B\u53CD\u800C\u662F\u662F\u66F4\u4F18\u89E3\u3002</p><p>\u56FE\u4E66\u9986\u7684\u95ED\u9986\u65F6\u95F4\u4E3A 21:55\uFF0C\u7535\u5B50\u9605\u89C8\u5BA4\u6709\u5927\u91CF\u63D2\u5EA7\u53EF\u4F7F\u7528\uFF0C\u53EF\u4EE5\u643A\u5E26\u7535\u8111\u524D\u5F80\u3002</p><p>B13\u3001B14 \u7684\u7A7A\u6559\u5BA4\u5F88\u5BCC\u4F59\uFF0CB5-206 \u7684\u63D2\u5EA7\u5728 B4~B7 \u7684\u666E\u901A\u6559\u5BA4\u4E2D\u6700\u591A\uFF0C\u8BFE\u684C\u6905\u73AF\u5883\u8212\u9002\u3002</p><p>B7 \u4E0E B13 \u9002\u5408\u901A\u5BB5\u81EA\u4E60\u6216\u81EA\u4E60\u5230 23 \u70B9\u4EE5\u540E\uFF0C\u4FDD\u5B89\u53EA\u4F1A\u63D0\u9192\u4F60\u5173\u706F\u4F46\u662F\u4E0D\u4F1A\u8D76\u4F60\u8D70\uFF0C\u5176\u4ED6\u5730\u65B9\u7684\u4FDD\u5B89\u5219\u4F1A\u50CF\u50AC\u547D\u9B3C\u4E00\u6837\u5730\u50AC\u4FC3\u4F60\u79BB\u5F00\u3002\u4E0D\u8FC7\uFF0C\u8BF7\u5927\u5BB6\u6CE8\u610F\u8EAB\u4F53\u5065\u5EB7\uFF0C\u5E73\u65F6\u591A\u770B\u4E66\uFF0C\u8003\u524D\u5C31\u4E0D\u7528\u62B1\u5927\u817F\u5566~</p><h3 id="\u5173\u4E8E\u4E34\u5E8A\u4E13\u4E1A\u7684\u89C1\u4E60\u4E0E\u5B9E\u4E60" tabindex="-1"><a class="header-anchor" href="#\u5173\u4E8E\u4E34\u5E8A\u4E13\u4E1A\u7684\u89C1\u4E60\u4E0E\u5B9E\u4E60" aria-hidden="true">#</a> \u5173\u4E8E\u4E34\u5E8A\u4E13\u4E1A\u7684\u89C1\u4E60\u4E0E\u5B9E\u4E60</h3><p>\u5982\u679C\u8BFB\u7684\u662F\u533B\u5B66\u7C7B\u7684\u4E34\u5E8A\u4E13\u4E1A\uFF0C\u5927\u4E09\u6625\u5B63\u5B66\u671F\u4E0E\u5927\u56DB\u79CB\u5B63\u5B66\u671F\u5C06\u4F1A\u6709\u63A5\u8FD1\u4E00\u5E74\u7684\u4E34\u5E8A\u89C1\u4E60\uFF08\u5373\u4E34\u5E8A\u8BFE\u7A0B\u5E8A\u8FB9\u6559\u5B66\uFF09\u3002\u671F\u95F4\uFF0C\u6C5F\u82CF\u7701\u5185\u5B66\u751F\u4F18\u5148\u8FD4\u56DE\u751F\u6E90\u5730\u89C1\u4E60\uFF0C\u7701\u5916\u5B66\u751F\u4F3C\u4E4E\u53EF\u4EE5\u81EA\u7531\u9009\u62E9\u7559\u5728\u5357\u4EAC\u8FD8\u662F\u53BB\u5176\u4ED6\u5730\u5E02\uFF0C\u5728\u5357\u4EAC\u7684\u5B66\u751F\u4ECD\u4F4F\u5728\u4ED9\u6797\u6821\u533A\u3002\u90E8\u5206\u5B66\u957F\u5B66\u59D0\u53CD\u6620\uFF0C\u5357\u4EAC\u5E02\u7684\u533B\u9662\u5E8A\u8FB9\u6559\u5B66\u8003\u6838\u4E25\u683C\u5EA6\u9AD8\u4E8E\u5176\u4ED6\u5730\u5E02\uFF0C\u5982\u679C\u60F3\u8981\u63D0\u524D\u51C6\u5907\u8003\u7814\uFF0C\u5176\u4ED6\u5730\u5E02\u7684\u533B\u9662\u4F1A\u677E\u4E00\u4E9B~</p><p>\u8003\u8651\u5230<s>\u836F\u5DDE</s>\u82CF\u5DDE\u540C\u7C7B\u6D53\u5EA6\u9AD8\uFF0C\u6709\u5229\u4E8E\u4E92\u5E2E\u4E92\u52A9\u7684\u7279\u70B9\uFF0C\u53EF\u4EE5\u8003\u8651\u524D\u5F80\u82CF\u5DDE\u7684\u4E24\u6240\u6821\u9644\u5C5E\u533B\u9662\u89C1\u4E60\uFF0C\u4F46\u4F4F\u5BBF\u5982\u4F55\u89E3\u51B3\uFF0C\u7B14\u8005\u5C1A\u672A\u63A2\u7D22\u3002</p><p>\u5927\u4E94\u4E34\u5E8A\u5B9E\u4E60\u671F\u95F4\u6709\u53EF\u80FD\u4F1A\u642C\u5230\u5BBF\u820D\u6761\u4EF6\u6781\u5DEE\u7684\u6C49\u4E2D\u95E8\u6821\u533A\uFF0C\u5BF9 MtF \u5F53\u7136\u662F\u6781\u5EA6\u7684\u4E0D\u53CB\u597D\uFF0C\u4E0D\u8FC7\u7531\u4E8E\u76EE\u524D\u6C49\u4E2D\u95E8\u6821\u533A\u5BBF\u820D\u7D27\u7F3A\uFF0C\u4ECA\u5E74\u53EA\u6709\u5B9E\u4E60\u7684\u987A\u6027\u522B\u5973\u751F\u642C\u8FC7\u53BB\u4E86\uFF0C\u5982\u679C\u5B9E\u5728\u6CA1\u529E\u6CD5\u53EF\u4EE5\u8003\u8651\u5728\u6C49\u4E2D\u95E8\u9644\u8FD1\u79DF\u623F\u5B50\u3002\u4E0D\u8FC7\uFF0C\u6839\u636E\u6700\u65B0\u7684\u60C5\u51B5\u53CD\u9988\uFF0C\u6C49\u4E2D\u95E8\u6821\u533A\u90E8\u5206\u5BBF\u820D\u5728 2021 \u5E74\u8FDB\u884C\u4E86\u88C5\u4FEE\uFF0C\u5BBF\u820D\u53D8\u6210\u4E86\u548C\u4ED9\u6797\u6821\u533A\u4E00\u6837\u7684\u4E0A\u5E8A\u4E0B\u684C\uFF0C\u4E14\u6536\u7EB3\u7BB1\u5F88\u591A\uFF0C\u867D\u7136\u6D17\u6D74\u65B9\u9762\u8FD8\u662F\u5927\u6D74\u5BA4\uFF0C\u4F46\u662F\u53EF\u4EE5\u5B89\u88C5\u5E18\u5B50\u4E86\uFF0C\u5927\u8FDB\u6B65~\uFF01</p><p>\u4F3C\u4E4E\u6700\u7EC8\u524D\u5F80\u54EA\u4E2A\u533B\u9662\u7684\u9009\u62E9\u65B9\u6848\u4E0E\u548C\u89C1\u4E60\u662F\u4E00\u6837\u7684\uFF0C\u5373\u7701\u5185\u751F\u6E90\u5730\u4F18\u5148\uFF0C\u5916\u7701\u5B66\u751F\u81EA\u7531\u9009\u62E9\uFF0C\u5F85\u8003\u8BC1\u3002</p><h3 id="\u5173\u4E8E\u8003\u7814\u53BB\u5411" tabindex="-1"><a class="header-anchor" href="#\u5173\u4E8E\u8003\u7814\u53BB\u5411" aria-hidden="true">#</a> \u5173\u4E8E\u8003\u7814\u53BB\u5411</h3><p>\u8003\u8651\u5230<s>\u836F\u5DDE</s>\u82CF\u5DDE\u540C\u7C7B\u6D53\u5EA6\u9AD8\u7684\u7279\u70B9\uFF0C\u5982\u679C\u7814\u7A76\u751F\u9636\u6BB5\u4ECD\u7136\u5E0C\u671B\u5728\u4E2D\u533B\u836F\u9886\u57DF\u8FDB\u4FEE\uFF0C\u53EF\u4EE5\u5173\u6CE8\u4E00\u4E0B\u82CF\u5DDE\u5728\u5EFA\u7684\u4E2D\u56FD\u4E2D\u533B\u79D1\u5B66\u9662\u5927\u5B66\uFF08\u73B0\u4E3A\u4E2D\u56FD\u4E2D\u533B\u79D1\u5B66\u9662\u7814\u7A76\u751F\u9662\uFF09\u3002</p><div style="text-align:right;"><p>\u7531 Ameki \u6295\u7A3F</p></div>',48),n=[p];function i(h,l){return e(),a("div",null,n)}var x=t(d,[["render",i],["__file","NJUCM.html.vue"]]);export{x as default};
